//将数字各个位置的数字取出
function numToArray(num){
    //取数据的整数位
    var intNum=parseInt(num);
    //取数据的小数位置
    var pointNum=num-intNum;
    //获取整数位数组
    var intArr=getInt(intNum);
    //获取小数位数组
    var pointArr=getPoint(pointNum);
    //合并数据
    return intArr.concat(pointArr);
}

//取整数位
function getInt(num){
    var numArray=new Array();
    while(num>0){
       var val=num%10;
       numArray.push(val);
       num=num/10;
       num=parseInt(num);
    }
    return numArray.reverse();
}

//获取小数位
function getPoint(pointNum){
    var num=parseInt(pointNum.toFixed(2)*100);
    return getInt(num);
}

//将数组中的数字转为对应图片，并显示再指定div中
function arrTransPic(num){
   var result=numToArray(num);
   for(var i=0;i<result.length;i++){
       var val=result[i];
       $('#data').append("<img src='"+pictures[val]+"' style='dispaly:inline-block;margin-left:-7px'>");
   }
}

